import React from "react";
import "./Sidebar.css";
import SidebarRow from "./SidebarRow";
import examplePicture from "../src/assets/exampleAvatar.jpg";
import LocalHospitalIcon from "@material-ui/icons/LocalHospital";
import EmojiFlagsIcon from "@material-ui/icons/EmojiFlags";
import PeopleIcon from "@material-ui/icons/People";
import ChatIcon from "@material-ui/icons/Chat";
import StoreFrontIcon from "@material-ui/icons/StoreFront";

function Sidebar() {
  return (
    <div className="sideBar">
      <SidebarRow src={examplePicture} title={"Bar Dori"} />
      <SidebarRow title="Friends" />
      <SidebarRow
        Icon={LocalHospitalIcon}
        title="COVID-19 Information Center"
      />
      <SidebarRow Icon={EmojiFlagsIcon} title="Pages" />
      <SidebarRow Icon={PeopleIcon} title="Pages" />
      <SidebarRow Icon={Chat} title="Pages" />
      <SidebarRow Icon={stroreFront} title="Pages" />
      <SidebarRow Icon={PeopleIcon} title="Pages" />
      <SidebarRow />
    </div>
  );
}

export default Sidebar;
